import './PopUp.css'
import { Link } from 'react-router-dom';


export default function PopUp() {


    return (

        <div className='popup'>
            Done!
            <Link className='link' to="/Home">
                <button className="btn">Home</button>
            </Link>
        </div>
    )
}
